import React from 'react'
import {BrowserRouter as Router, Route} from 'react-router-dom'
import {useRoutes} from './routes'
import 'materialize-css'

function App() {
  const routes = useRoutes()

  return (
    <Route>
      <div className="container">
        {routes}
      </div>
    </Route>
  )
}

export default App;
